/****** Script for SelectTopNRows command from SSMS  ******/

DECLARE @LOCAL_TABLEVARIABLE TABLE
(fName nvarchar(255), 
 sName nvarchar(255), 
 lName nvarchar(255),
 email nvarchar(255),
 phone nvarchar(255),
 course1 nvarchar(255),
 [group1] nvarchar(255),
 [fn] nvarchar(255),
 years datetime2,
 EducationForm int,
 EducationalQualificationDegree int,
 Abbreviation nvarchar(255),
 SpName nvarchar(255) default NULL
)








--Magistar

--Учител


--SELECT * FROM LOCAL_TABLEVARIABLE


DECLARE @fName nvarchar(255) 
DECLARE @sName nvarchar(255) 
DECLARE @lName nvarchar(255)
DECLARE @email nvarchar(255)
DECLARE @phone nvarchar(255)
DECLARE @course1 nvarchar(255)
DECLARE @group1 nvarchar(255)
DECLARE @FacNumber nvarchar(255)
DECLARE @years datetime2	  
DECLARE @EducationForm int		  
DECLARE @EducationalQualificationDegree int
DECLARE @Abbreviation nvarchar(255)
DECLARE @SpName nvarchar(255)
DECLARE @CurriculumId int
SET @CurriculumId = 0

DECLARE MY_CURSOR CURSOR 
  LOCAL STATIC READ_ONLY FORWARD_ONLY
FOR 
SELECT DISTINCT *  
FROM @LOCAL_TABLEVARIABLE ORDER BY Abbreviation

OPEN MY_CURSOR
FETCH NEXT FROM MY_CURSOR INTO @fName, @sName, @lName, @email, @phone, @course1, @group1, @FacNumber, @years, @EducationForm, @EducationalQualificationDegree, @Abbreviation, @SpName
WHILE @@FETCH_STATUS = 0
BEGIN 
    --Do something with Id here
    --PRINT CONCAT( @fName, @sName, @lName, @email, @phone, @course1, @group1, @FacNumber, @years, @EducationForm, @EducationalQualificationDegree, @Abbreviation)
    
	
	IF NOT EXISTS(SELECT FacultyNumber FROM [StudentSystem].[dbo].[Students] WHERE FacultyNumber = @FacNumber)
		BEGIN
			--PRINT CONCAT('Missing', @fName, @sName, @lName, @email, @phone, @course1, @group1, @FacNumber, @years, @EducationForm, @EducationalQualificationDegree, @Abbreviation)

			SELECT @CurriculumId = c.Id 
			FROM [StudentSystem].[dbo].[Curriculums] c
			JOIN [StudentSystem].[dbo].[Specialties] sp	ON c.SpecialtyId = sp.Id
			WHERE c.EducationForm = @EducationForm AND c.EducationalQualificationDegree = @EducationalQualificationDegree AND sp.Abbreviation = @Abbreviation

			IF (@CurriculumId = 0)
				BEGIN
					--PRINT'Missing'
					--PRINT CONCAT('Missing', @fName, @sName, @lName, @email, @phone, @course1, @group1, @FacNumber, @years, @EducationForm, @EducationalQualificationDegree, @Abbreviation)
					--PRINT CONCAT(@EducationForm,';', @EducationalQualificationDegree,';', @Abbreviation)
					PRINT CONCAT('Missing', @fName,';', @sName,';', @lName,';', @email,';', @phone,';', @course1,';', @group1,';', @FacNumber,';', @years,';', @CurriculumId,';', @Abbreviation,';', @SpName)
					
					DECLARE @SpecialtyId int
					SELECT @SpecialtyId = SCOPE_IDENTITY()
					SELECT @CurriculumId = SCOPE_IDENTITY()
					VALUES (@fName, @sName, @lName, @email, @phone, @course1, @group1, @FacNumber, @years, @CurriculumId, NULL)

				END
			ELSE
				BEGIN
					PRINT CONCAT('Insert', @fName,';', @sName,';', @lName,';', @email,';', @phone,';', @course1,';', @group1,';', @FacNumber,';', @years,';', @CurriculumId,';', @Abbreviation,';', @SpName)
					VALUES (@fName, @sName, @lName, @email, @phone, @course1, @group1, @FacNumber, @years, @CurriculumId, NULL)
				END			

			SET @CurriculumId = 0

		END
	--ELSE
		--BEGIN
			--PRINT CONCAT('Exist', @fName, @sName, @lName, @email, @phone, @course1, @group1, @FacNumber, @years, @EducationForm, @EducationalQualificationDegree, @Abbreviation)
		--END


	FETCH NEXT FROM MY_CURSOR INTO @fName, @sName, @lName, @email, @phone, @course1, @group1, @FacNumber, @years, @EducationForm, @EducationalQualificationDegree, @Abbreviation, @SpName
END
CLOSE MY_CURSOR
DEALLOCATE MY_CURSOR

